import React from "react";
import style from "./Frame.module.css";
import ItemFrame from "./ItemFrame/ItemFrame";
import defState from "../../Redux/defState";

function Frame(props) {

    let ItemFrameElements = defState.itemList.map( elItem => {
        return(
            <ItemFrame id={elItem.id} name={elItem.name} price={elItem.price} imgItem={elItem.imgItem}/>
        )
    })

    return (
      <div className={style.frame}>
          <div className={style.frame_head}>
              <div className={style.top_hr}></div>
              <div className={style.frame_text_head}>Одежда</div>
          </div>

          <div className={style.frame_body}>
              {ItemFrameElements}
          </div>
      </div>
    )
    }

export default Frame;
